package IfElseStatement;

public class IfElseClass2{

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		int b=20;
		int c=30;
		int d=40;
		int e=50;
		int f=60;
		int g=70;
		int h=70;
		int i=90;
		int j=100;
		int k=110;
		int l=110;
		//Relational operators
		
		//<,><=,>=,==,!=
		
		if(a!=b)
		{
			System.out.println("a is not equal to b");
		}
		
		if(c<d)
		{
			System.out.println("c is less than d");
		}
		if(f>e)
		{
			System.out.println("f is greater than e");
		}
		if(g<=h)
		{
			System.out.println("g is less than or equal to h");
		}
		if(j>=i)
		{
			System.out.println("j is greater than or equal to i");
		}
		if(k==l)
		{
			System.out.println("k is equal to l");
		}
		
		
	
	
	}
	
	

}
